import React from 'react'
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";

function Use_Case() {
  return (
    <div>
        <Container fluid>
            <Row>
                <div>
                    <h1 className='text-center mt-5'>Use Cases In Different Industries</h1>
                </div>
            </Row>
            <Row>
                <div></div>
                <h3 className='text-center'>Factory Space</h3>
            </Row>
        </Container>

    </div>
  )
}

export default Use_Case
